import './aboutme.css';


function AboutMe() {
  return (
   <div>
        <h1 className="header">A brief history</h1>
        <div className='aboutme-container'>
            <h1>I'm Ploy, a Software Engineer.</h1>
            <p>Out of work you'll find me  catch me meditating through outdoor runs, fusing Thai-Italian fusion cuisine in kitchen lab, experimenting with AI-enhanced home automation, or shredding the slopes on my snowboard when winter comes.</p>
        </div>
    </div>
  )
}

export default AboutMe;
